def how_many_times(string: str, substring: str) -> int:
    # Check for edge case where either input is empty
    if not string or len(substring) > len(string):
        return 0

    count = 0
    start_index = 0

    while True:
        start_index = string.find(substring, start_index)
        if start_index == -1:
            break
        count += 1
        start_index += 1

    return count
